The classes with the asterisks do not typically get passed to the 'com.itko.lisa.annotations.Module' Annotation Processor (AP).  I say typically because every blue moon eclipse will pass all 22 annotated classes to the AP during a build.  What usually happens is that we consistently get 8 annotated classes in the 1st AP round and then 7 in the 2nd.

The AP's process() methid looks like the following:

