Eclipse Project to demonstrate the compiler bug

OK, after days of digging I finally know enough to create a project that reproduces the bug.  In a host IDE import the org.eclipse.jdt.core plug-in.  I've modified my code so line #'s likely don't match up, but in the AbstractImageBuilder.compile(SourceFile[] units) method add a breakpoint to the if statement in the method:

	SourceFile unit = remainingUnits[remainingIndex];
*	if (unit != null && (compilingFirstGroup || this.workQueue.isWaiting(unit))) {

Set the breakpoint properties to:
if (unit != null)
{
	if (unit.initialTypeName.contains("Module"))
	{
		System.out.println("=0= is waiting: " + unit.initialTypeName
			+ " - " + workQueue.isWaiting(unit));
	}
}
return false;

Now run a runtime IDE and import the AnnoTest.zip The project contains 3008 classes. When the code is compiled you should get 8 output lines like from the breakpoint:

=00= is waiting: g/ModuleCore - true
=00= is waiting: f/ModuleF - true
=00= is waiting: e/ModuleE - true
=00= is waiting: d/ModuleD - true
=00= is waiting: c/ModuleC - true
=00= is waiting: b/ModuleB - true
=00= is waiting: a/ModuleLegacy - false
=00= is waiting: a/ModuleA - true

However the annotation processor will output 7 lines:

Annotation Processing: e.ModuleE
Annotation Processing: d.ModuleD
Annotation Processing: f.ModuleF
Annotation Processing: c.ModuleC
Annotation Processing: g.ModuleCore
Annotation Processing: a.ModuleA
Annotation Processing: b.ModuleB

The bulk of the 3008 classes are named [A-F][1-500] (i.e. A11, B200, C346, etc). Every 100 classes (A100, A200, C300, ...) the code contains a reference to the g.ModuleCore class.  The ModuleCore class contains a reference to the a.ModuleLegacy class.  On my system putting ModuleLegacy in package a caused it to not be in the 1st round of compilation.  I have no idea how eclipse chooses the compile order so you might need to move the class to a new package to get the bug to be reproducible.

I'm not ready to point fingers but when all the code is compiled at once then the NameEnvironmentAnswer code is not involved.  However when the compile is chunked up and the annotated class is not in the 1st round but is referenced by code that is in the 1st round then it gets pulled in and compiled.  So for this example compiling F100.java will have a reference to ModuleCore.  ModuleCore is already in the 1st round so that is fine, however ModuleCore has a reference to ModuleLegacy which isn't in the 1st round.  If I understand the code right, this will cause a NameEnvironmentAnswer to be produced for ModuleLegacy which will ultimately result in it being compiled.  The problem is that the class is never checked for annotations and then being added to the correct list for future annotation processing.

When I modified the AbstractImageBuilder.compile() method from

	if (unit != null && (compilingFirstGroup || this.workQueue.isWaiting(unit))) {
		if (JavaBuilder.DEBUG)
			System.out.println("About to compile #" + remainingIndex + " : "+ unit.typeLocator()); //$NON-NLS-1$ //$NON-NLS-2$
		toCompile[count++] = unit;
	}

to

	if (unit != null) {
		if (compilingFirstGroup || this.workQueue.isWaiting(unit) ||
			unit.initialTypeName.contains("Module")) {
			if (JavaBuilder.DEBUG)
				System.out.println("About to compile #" + remainingIndex + " : "+ unit.typeLocator()); //$NON-NLS-1$ //$NON-NLS-2$
			toCompile[count++] = unit;						
		}
	}

Then it worked.  So then a fix may be to some how get annotated NameEnvironmentAnswer provided classes back on the compile list.

FYI, The source for the annotation processor is in the annotest-ap.jar and was compiled for java 7.
